Asynchronous Transmission for Everyone?

     Request API works for asynchronous sources --
                      asyncronous() {
                              wait for (event) {                                      get_data();                                      send();                      }                            
     What about synchronous sources? (e.g., audio)
                      do_every_10_ms () {                              get_data();                              send();                      }

1 minute TCL tutorial 
set a 1 
set b [expr $a + 2] 
proc list_total {list} {
set tmp 0foreach l $list {
incr tmp $l
}
return $tmp
} 
set c [list_total {1 2 3 4 5}]puts "a: $a b: $b c: $c" 
1 minute oTCL tutorial 
Class car 
car instproc init {args} {
$self instvar wheels_ set wheels_ 4 
} 
Class vw -superclass car
vw instproc init {args} {
$self instvar wheels_ vendor_ 
set vendor_ "vw" 
eval $self next $args
} 
set a [new car]
puts "A: a car with [$a set wheels_] wheels"
set b [new vw]
puts "B: a [$b set vendor_] with [$b set wheels_] wheels"
